import React from 'react';
import './FaceRecognition.css';

const FaceRecognition = ({imageUrl, box}) => {
    return (
        <div className='center ma'>
            <div className="absolute mt2 mb2">
            <img id="inputimage" alt='foto' src={imageUrl} width='500px' height="auto"/>
            <div className="bounding-box" style={{top: box.leftCol, right: box.topRow, bottom: box.leftCol, left: box.bottomRow }}>

            </div>
            </div>
        </div>
    )
}

export default FaceRecognition;
